VALUES ('3436598134495', 'Halal Pocket dinde et fomage', 'Pâte (50%) : farine de BLÉ, eau, fécule de pomme de terre, huile de tournesol, sel, sucre, GLUTEN de BLÉ, levures, poudres à lever : E450, 600, fibre de BLÉ. Garniture (50%) : sauce tomate (17%) (purée de tomate, eau, huile de tournesol, sel, sucre, épiles et plantes aromatiques), Préparation à base de viande de dinde saumurée Halal (13%) :Viande de dinde Halal (origine UE), eau, fécule de pomme de terre, gélifiants : E407a, E407, E425, acidifiants : E326 et E262, sel, sirop de glucose, dextrose, stabilisants : E450 et E451, fibres végétales, exhausteur de goût E621, protéine de SOJA, arômes, antioxydant E316, conservateur : E250, FROMAGE MOZZARELLE (10%), FROMAGE EMMENTAL (10%). Traces possibles de moutarde et d\'oeufs. MODE DE PRÉPARATION : Au micro-ondes : Enlevez le film plastique et insérez le pocket dans l\'étui pour cuisson micro-ondes. Posez sur une assiette et réchauffez au four micro-ondes (2min./900W). Enlevez l\'étui de cuisson et laissez reposer 2 minutes avant de déguster. ATTENTION : les temps de cuisson indiqués peuvent varier en fonction du type et de la marque du four. ATTENTION, TRES CHAUD ! Au four : Préchauffez le four pendant 10 minutes à 1800C. Enlevez le film plastique et l\'étui, puis placez le pocket dans le four à mi-hauteur. Laissez cuire 10 à 12 minutes. CONSERVATION : Dans un à -ICC. NE JAMAIS RECONGELER UN PRODUIT DÉCONGELÉ A consommer de préférence avant la date de durabilité minimale indiquée sur le côté de la boîte.', '', '9.9', '4.8', '23.7', '2.6', '', '11.4', '1.5', '0.590551181102362', '', '0');

